// UserList.js

import React from 'react';

const UserList = ({ users, fetchUsers, deleteUser, editUser }) => {
  return (
    <div>
      <h2>User List</h2>
      <table>
        {/* Table headers */}
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Address</th>
            <th>Pincode</th>
            <th>Action</th>
            <th>Edit</th>
          </tr>
        </thead>
        {/* Table body */}
        <tbody>
          {/* Map over users array to render user data */}
          {users.map(user => (
            <tr key={user._id}>
              {/* Display user data in table cells */}
              {/* Add your table cells here */}
              <td>
                <button onClick={() => deleteUser(user._id)} className="delete-button">
                  Delete
                </button>
              </td>
              <td>
                <button onClick={() => editUser(user._id, user)} className="edit-button">
                  Edit
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserList;
